import react from "react";
import { Paper, Container } from "@material-ui/core";

export default function BlogCard() {
  const myStyle = {
    height: "100vh",
  };
  return (
    <div>
      <Container maxWidth="lg">
        <Paper style={myStyle}>BlogCard</Paper>
      </Container>
    </div>
  );
}
